(()=>{"use strict";class t{constructor(t){this.name=t,this.todos=[]}getName=()=>this.name;setName=t=>this.name=t;getTodos=()=>this.todos;setTodos=t=>this.todos=t;addTodo=t=>this.todos.push(t);deleteTodo=t=>{const s=this.todos.find((t=>t.getName()===t));this.todos.splice(this.todos.indexOf(s),1)}}class s{constructor(t,s="",e="No due date",o=null,i=!1){this.title=t,this.description=s,this.dueDate=e,this.priority=o,this.isDone=i}getTitle=()=>this.title;setTitle=t=>this.title=t;getDescription=()=>this.description;setDescription=t=>this.description=t;getDueDate=()=>this.dueDate;setDueDate=t=>this.dueDate=t;setPriority=t=>this.priority=t;getPriority=()=>this.priority;setIsDone=t=>this.isDone=t;getIsDone=()=>this.isDone}class e{constructor(){const e=new t("My Todos"),o=new s("todo1","desc","2021-05-29","high",!1);e.setTodos([o]),this.projects=[],this.projects.push(e),this.projects.push(new t("Art Lesson for 5/25")),this.projects.push(new t("Tuesday class"))}getProjects=()=>this.projects;setProjects=t=>this.projects=t;getProject=t=>this.projects.find((s=>s.getName()===t));addProject=t=>this.projects.push(t);deleteProject=t=>{const s=this.projects.find((s=>s.getName()===t));this.projects.splice(this.projects.indexOf(s),1)}}class o{static loadHome=()=>{o.loadProjects(),o.loadTodos("My Todos")};static loadProjects(){(new e).getProjects().forEach((t=>{o.createProject(t.name)}))}static loadTodos(t){(new e).getProject(t).getTodos().forEach((t=>{o.createTodo(t)}))}static createProject=t=>{document.querySelector(".projects").innerHTML+=`\n      <li class='project'>\n        <i class='fas fa-folder'></i>\n        <span>${t}</span>\n      </li>\n    `};static createTodo(t){document.querySelector(".todos").innerHTML+=`\n    <li class='todo'>\n    <i class='fas fa-circle'></i>\n    <span>${t.title}</span>\n  </li>\n    `}}document.body.addEventListener("DOMContentLoaded",o.loadHome())})();